import React from "react";
import { IoIosNotifications } from "react-icons/io";

export default function Nav() {
    return <>
    <div class="toolbar">
        <div class="toolbar-icons">
        <IoIosNotifications className="icon"/>
            <i class="icon icon2">icon2</i>
        </div>
    </div>
    </>
}
